import React from "react";
import "./style.css";

function UserCard(props) {
  return (
    <ul className="list-group search-results">
        <li key={props.login.uuid} className="list-group-item">
          <p><strong>Name:</strong> {props.name.first} {props.name.last}</p>
          <p><strong>State:</strong> {props.location.state}</p>
          <p><strong>Gender:</strong> {propst.gender}</p>
        </li>
    </ul>
  );
}

export default UserCard;
